INSERT OR IGNORE INTO wp_term_taxonomy (term_taxonomy_id, term_id, taxonomy, description, parent, count) VALUES (1846, 1846, 'product_tag', '<h2>Mona flying penny loafers</h2>
&nbsp;

Presenting to you here is Mona Flying Penny Loafers, a shoe line from the <a href="https://shopwice.com/brand/mona-flying-shoes">Mona Flying Shoe</a> collection we have available on shopwice. These Penny Loafers are classic and timeless in style. Their casual and formal style boasts a round and almond toe with a front belt at the upper and a flat to mid-heel of 2cm to 4cm in height.

These footwears are hand-crafted to specifications combining advanced design and top-rate technique from skilful craftsmen with over 30-year experience, to create amazing comfort, chic style and outstanding durability.
<h2>Details</h2>
<div>
<h3 class="a-spacing-mini apm-iconheader">Luxury Sheepskin Upper</h3>
</div>
<div>Luxury sheepskin uppers with brogue perforations offer a superior wear experience and a chic look</div>
<div>
<div class="apm-righthalfcol">
<div>
<h3 class="a-spacing-mini apm-iconheader">Breathable Leather Lining</h3>
</div>
<div><span style="color: #555555;font-size: 14.4px">Soft leather sock lining and irremovable Leather-covered latex Insole boast long-lasting comfort</span></div>
</div>
<div></div>
<div class="apm-lefthalfcol">
<div>
<h3 class="a-spacing-mini apm-iconheader">Low Stack Heel</h3>
</div>
<div>
<p class="a-spacing-base">0.98 in (2.5cm) heel offers an elegant look, perfect for everyday wear</p>

</div>
</div>
<div class="apm-righthalfcol">
<div>
<h3 class="a-spacing-mini apm-iconheader">Durable Rubber Sole</h3>
</div>
<div><span style="color: #555555;font-size: 14.4px">A rubber outsole with a leather welt ensures stability and durability yet is incredibly lightweight</span></div>
</div>
</div>
&nbsp;

&nbsp;', 0, 0);
